import React, { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
// import * as Yup from "yup";
import { useFormik } from "formik";

function Signup() {
  const [form, setForm] = useState("");

  const formik = useFormik({
    initialValues: {
      name: "",
      email: "",
      password: "",
    },
    onSubmit: async (values) => {
      try {
        await axios.post("/api/signup", values);
        alert("User registered successfully!");
      } catch (error) {
        alert("An error has ocurred while registering user.");
        console.error(error);
      }
    },
  });

  const handleChange = (e) => {
    setForm(e.target.value);
  };

  //   const validationSchema = Yup.object().shape({
  //     username: Yup.string().min(3).max(15).required(),
  //     password: Yup.string().min(4).max(20).required(),
  //   });

  //   const onSubmit = async (data) => {
  //     await axios.post("http://localhost:3001/auth", data);
  //     console.log(data);
  //   };

  return (
    <div className="d-flex justify-content-center align-items-center bg-primary vh-100">
      <div className="bg-white p-3 rounded-w-25">
        <h2 className="fs-1 mb-3">Sign-Up</h2>
        <form onSubmit={formik.onSubmit}>
          <div className="mb-3">
            <label htmlFor="name">
              <strong>Name:</strong>
            </label>
            <input
              id="name"
              name="name"
              type="text"
              placeholder="Enter Name"
              onChange={handleChange}
              className="form-control rounded-0"
              value={formik.values.name}
            />
          </div>
          <div className="mb-3">
            <label htmlFor="email">
              <strong>Email:</strong>
            </label>
            <input
              type="email"
              placeholder="Enter Email"
              onChange={handleChange}
              className="form-control rounded-0"
              value={formik.values.email}
            />
          </div>

          <div className="mb-3">
            <label htmlFor="password">
              <strong>Password:</strong>
            </label>
            <input
              type="password"
              placeholder="Enter Password"
              onChange={handleChange}
              className="form-control rounded-0"
              value={formik.values.password}
            />
          </div>

          <button type="submit" className="btn btn-success w-100 rounded-0">
            Sign up
          </button>
          <p className="mb-3">You are agree to our terms and policies</p>
          <Link
            to="/login"
            className="btn btn-default border w-100 bg-light rounded-0 text-decoration-none"
          >
            Log in
          </Link>
        </form>
      </div>
    </div>
  );
}

export default Signup;

<div className="d-flex justify-content-center align-items-center bg-primary vh-100">
  <div className="bg-white p-3 rounded-w-25">
    <h2 className="fs-1 mb-3">Sign-Up</h2>
    <Formik
      initialValues={initialValues}
      onSubmit={onSubmit}
      validationSchema={validationSchema}
    >
      <Form className="formContainer">
        <label>Name:</label>
        <ErrorMessage name="name" component="span" />
        <Field id="inputCreatePost" name="name" placeholder="(Ex. John123..)" />
        <label>Email:</label>
        <ErrorMessage name="password" component="span" />
        <Field
          type="password"
          id="inputCreatePost"
          name="password"
          placeholder="Your Password..."
        />
        <label>Password:</label>
        <ErrorMessage name="password" component="span" />
        <Field
          type="password"
          id="inputCreatePost"
          name="password"
          placeholder="Your Password..."
        />
        <button type="submit">Register</button>
      </Form>
    </Formik>
  </div>
</div>;
